import axios from 'axios';

const baseURL = 'http://localhost:5000/'

const AppLogin = (username, password) => {
    axios.post(`${baseURL}/login`, {
        username: username,
        password: password
      })
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      });
}

export default AppLogin
